{
  "type": "module",
  "engines": {
    "node": ">=22.0"
  },
  "scripts": {
    "start": "parcel watch src/manifest.json --host localhost",
    "build": "parcel build src/manifest.json",
    "test": "xo",
    "release": "release:*",
    "release:ff": "npx web-ext-submit --source-dir src",
    "release:chrome": "npx webstore upload --source=isometric-contributions.zip --auto-publish"
  },
  "dependencies": {
    "lodash-es": "^4.17.21"
  },
  "devDependencies": {
    "@parcel/config-webextension": "^2.13.3",
    "@parcel/reporter-bundle-analyzer": "^2.13.3",
    "@parcel/reporter-bundle-buddy": "^2.13.3",
    "chrome-webstore-upload-cli": "^3.3.1",
    "parcel": "^2.13.3",
    "web-ext-submit": "^7.8.0",
    "xo": "^0.60.0"
  },
  "xo": {
    "prettier": true,
    "semicolon": false,
    "space": true,
    "prefer-numeric-literals": 0,
    "global": [
      "obelisk",
      "chrome"
    ],
    "env": [
      "browser"
    ],
    "rules": {
      "unicorn/prefer-top-level-await": 0,
      "n/no-unsupported-features/node-builtins": "off"
    }
  },
  "targets": {
    "default": {
      "engines": {
        "browsers": ">= 50%"
      }
    }
  }
}
